import React from 'react'
import { Link, useNavigate } from 'react-router-dom'

export const Navbar = () => {

  const navigate = useNavigate();


  const logOut = (e) => {
    e.preventDefault();
    localStorage.clear('user');
    setTimeout(() => {
        navigate(`/dang-nhap`);
    }, 500);
}

  return (
    <div className="navbar container">
      <Link to="/" className="logo">QL Thong Tin Ca Nhan</Link>
      {
        localStorage.user
        ?
        <Link to="/dang-nhap" onClick={e => logOut(e)} className="login-button">Dang xuat</Link>
        :
        <Link to="/dang-nhap" className="login-button">Dang nhap</Link>
      }
    </div>
  )
}
